import { useEffect, useState } from 'react';
import axios from 'axios';
import './App.css';

function App() {
  const [todos, setTodos] = useState([]);
  useEffect(() => {
    axios
      .get('https://jsonplaceholder.typicode.com/todos')
      .then((response) => 
      setTodos(response.data)
      )
      .catch((error) => console.log(error));
  },[]);



  return (
    <div className="App">
      <div className="card">

        <ul>
          <li></li>
        </ul>
      </div>
    </div>
  );
}

export default App;
